import { createStore } from "redux";
import rootReducer from './reducers/root'


const initialState = {habitslist : []};


export default function configStore(){
    return createStore(
        rootReducer, 
        initialState,
        window.devToolsExtension ? window.devToolsExtension() : f => f
    )

}
